import React from "react";
import ProjectDisp from "./ProjectDisp.js";
import codeImg from "../images/codeImg2.jpg";

export default function Projects() {
  return (
    <div>
      <ProjectDisp
        title="Pokemon Search App"
        image="Pokemon"
        tools="CSS, Javascript, Html"
        description="App to search pokemon manually or by name and learn detailed information on said pokemon"
      />
      <ProjectDisp
        title="Project 2"
        image={codeImg}
        tools="Javascript, Html, CSS, EJS, MongoDB, ExpressJs, NodeJS"
      />
    </div>
  );
}
